// F:\landinghub-iconic\apps\web\src\pages\AdminDashboard.js
import React from 'react';

const AdminDashboard = () => {
    return (
        <div className="admin-dashboard">
            <h1>Admin Dashboard</h1>
            <p>Chào mừng Admin! Quản lý hệ thống tại đây.</p>
            {/* Thêm nội dung cụ thể cho admin (e.g., quản lý user, thống kê) */}
        </div>
    );
};

export default React.memo(AdminDashboard);
